welcome to day 4
#holidayreset2018

self care is not just #metime but #metoo . self care is not being selfish. we are no use to anyone if our energy is already depleted because we have given every last bit of it away. self-care is an antidote to stress.
 today, i invite you to take a short roadtrip all by yourself. put on your favorite music and drive away. maybe drive to your favorite nearby park or just drive on a highway catching the sunrise or sunset. if you don‚Äôt drive, take a local bus or train and just take your moment to look around and enjoy the scenery. leave your planner and getaway for an hour or twoüòâ..
don‚Äôt forget to tag us to all your posts or comment on the box below by sharing your thoughts and how this challenge helping youüòä.
